export const setPokemonList = (pokemonList) => ({
  type: 'SET_POKEMON_LIST',
  payload: pokemonList,
});

export const capturePokemon = (pokemonName) => ({
  type: 'CAPTURE_POKEMON',
  payload: pokemonName,
});
